import React from "react";
import { Link } from "react-router-dom";

function RecipeListItem(props) {
  return (
    <Link to={`/form/${props.recipe.recipe_id}`}>
      <li>{props.recipe.recipe_name}</li>
    </Link>
  );
}

export default RecipeListItem;
